    value: The committee does not use any national party transfers to fund Federal
      Election Activity.  The party utilizes a strict accounting method to ensure
      that national party transfers are being used only for permissible administrative
      and overhead expenses.  This accounting method also guarantees that all Federal
      Election Activity is being funded by contributions raised under the limitations
      and prohibitions of the Federal Election Campaign Act, as amended.    The committee
      maintains a separate Levin account which was established solely for the receipt
      of Levin funds for Federal Election Activity according to 11 CFR 300.30.    The
      phrase Voter registration table in the purpose field on H6 is generic in nature
      and does not reference any federal candidate or any other Federal Election Activity.  The
      individuals who maintain these tables are not employees of the committee and
      therefore not subject to 11 CFR 300.33(d)(2).    To clarify the Refund/Rebates
      on Schedule A, line 15, the amount from Jon Barela for Congress is for reimbursements
      of copies made using our Xerox machine and postage used from our postage meter.
